import styles from 'styled-components';

export const Header = styles.header`
`;


export const HeaderImage = styles.img.attrs(props => ({
   src: props.Src,
   alt: props.Alt
}))`
   display: block;
   height: 1.6rem;
`;

export const HeaderButton = styles.button`
   padding: 0.8rem 1.6rem;
`;
